: : Rodimus Prime/Kup : :

Rodimus turns to his trusted friend Kup, who had just walked in.

Rodimus: Kup, do you know where Nighlight and Elita are?

Kup: Not sure, Roddy.

Kup looks over to whoever is closest bot.

Kup: Do you know where they are?

: : DeathStar : :

Within his quarters at the Tripred base, DeathStar awakes from a long sleep. He opens a commlink to Darkangel.

DeathStar(via comm): Darkangel, you read?

The comm message awakes Darkangel who had fallen asleep at his station on the Tripred bridge. He opens a return channel.

Darkangel(via comm): Yeah, I read you. I guess I had fellen asleep.

DeathStar: Odd, so did I. Any idea whats going on?

Darkangel: Let me find out.

Darkangel closes the channel and turns to a bridge officer.

Darkangel: Where is the commander?

: : SharpClaw/Wolfenstein : :

The two buddy Predacons awake in the Pred mess hall, with some big hangovers.

Wolf: Oh, man... How much did we have?

SharpClaw: Too much. My internal timer shows that we have been out for some time. Better contact Commander Hydras.

Wolf opens a channel.

Wolf: Commander Hydras, this is Wolfenstein. Is there any standing orders, sir?


